import React from "react";
import { Fath, FaUserAlt } from "react-icons/fa";

const Slidebar = () => {
  const menuItem = [
    {
      path: "/",
      name: "Dashboard",
      icon: "",
    },
    {
      path: "/academics",
      name: "Academics",
      icon: <FaUserAlt />,
    },
    {
      path: "/examination",
      name: "Examination",
      icon: <Fare />,
    },
  ];
  return (
    <div>
      <h1>this is Slidebar</h1>
    </div>
  );
};

export default Slidebar;
